import { appModel } from "../Models/AppModel";
import "../Styles/OutputBox.css";
import { useContext } from "react";
const OutputBox = () => {
  const { tokens, symTable, assembly } = useContext(appModel);
  const [buttonState, setButton] = useState(0);
  return (
    <>
      <div>
        <div className="Output-Header">
          <button className="Header-Btn">Tokens</button>
          <button className="Header-Btn">Symbol Table</button>
          <button className="Header-Btn">Assembly</button>
        </div>
        <div className="Output-Container">{tokens}</div>
      </div>
    </>
  );
};
export default OutputBox;
